img{
    max-width:30%;

.pagination a{
	font-size:1.5em;
	padding-left: 1em;
}
</style>
<script src="http://ajax.googleapis.com/ajax/libs/jquery/1.11.0/jquery.min.js"></script>

<script type="text/javascript">
/** Thanks for stackoverflow*/
Array.prototype.chunk = function(chunkSize) {
    var array=this;
    return [].concat.apply([],
        array.map(function(elem,i) {
            return i%chunkSize ? [] : [array.slice(i,i+chunkSize)];
        })
    );
};
String.prototype.endsWith = function(suffix) {
    return this.indexOf(suffix, this.length - suffix.length) !== -1;
};

/** Thanks for stackoverflow*/
function getParameterByName(name) {
    name = name.replace(/[\[]/, "\\[").replace(/[\]]/, "\\]");
    var regex = new RegExp("[\\?&]" + name + "=([^&#]*)"),
        results = regex.exec(location.search);
    return results == null ? "" : decodeURIComponent(results[1].replace(/\+/g, " "));
}

$().ready(function(){
    var PAGE_SIZE=9;
    var img_urls = [];
    $('div#repository imgx').each(function(index, element){
        img_urls.push( $(element).attr('src'));
    });
    var urls_per_pages = img_urls.chunk(PAGE_SIZE);
    //console.log(urls_per_pages);
    var page = parseInt(getParameterByName('page'));
    if(undefined === page || isNaN(page)){
        page = 0;
    }
    //console.log(page);
    var current_urls = urls_per_pages[page]
    //console.log( current_urls);
    
    //build view
    $.each(current_urls, function(index, value){
		var imgurl =value;
		if(imgurl.endsWith("mp4")){
			imgurl = "http://www.graphicsfuel.com/wp-content/uploads/2011/05/video-clapperboard-512x512.png";
		}
		$('div#content').append('<a href="'+value+'"><img src="'+imgurl+'"></img></a>');
    });
    
    //build paginaton
    var base_url = location.href.replace(location.search,'');
    //console.log(base_url);
    
    $.each(urls_per_pages, function(index, value){
        $('div.pagination').append('<a href="'+base_url+'?page='+index+'">'+index+'</a> ');
    });
});

</script>
